graphql.query:
mutation ($payload:MedplayaCreateMessageInput!)
{
	medplayaCreateMessage (payload:$payload)
	{
		id
		question
		chatResponse
		clientId
	}
}

query ($query:QueryStatement $constraint:QueryStatement)
{
	medplayaPaginateMessages (query:$query constraint:$constraint)
	{
		total
		count
		rows
	}
}

query ($query:QueryStatement)
{
	medplayaGetMessages (query: $query)
	{
		id
		question
		chatResponse
		createdAt
		updatedAt
	}
}

query ($query:QueryStatement)
{
	medplayaFindMessage (query: $query)
	{
		id
		question
		chatResponse
		createdAt
		updatedAt
	}
}

query ($id:ID)
{
	medplayaFindMessageById (id:$id)
	{
		id
		question
		chatResponse
		createdAt
		updatedAt
	}
}

mutation ($payload:MedplayaUpdateMessageInput!)
{
	medplayaUpdateMessage (payload:$payload)
	{
		id
		question
		chatResponse
		createdAt
		updatedAt
	}
}

mutation ($id:ID!)
{
	medplayaDeleteMessageById (id:$id)
	{
		id
		question
		chatResponse
		createdAt
		updatedAt
	}
}

mutation ($query:QueryStatement)
{
	medplayaDeleteMessages (query: $query)
	{
		id
		question
		chatResponse
		createdAt
		updatedAt
	}
}
